import React, { useEffect, useState } from "react";

const Fish = () => {
  const [users, setUsers] = useState([]);

  const getAllUser = async () => {
    const response = await fetch("/get");
    response.json().then((res) => setUsers(res.data.users));
    console.log(users);
  };

  useEffect(() => {
    getAllUser();
  }, []);

  return (
    <>
      {users.map((ce) => (
        <div key={ce.id}>
          <h2>{ce.name}</h2>
          <p>{ce.email}</p>
        </div>
      ))}
    </>
  );
};

export default Fish;
